import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Table,
  TableHeaderColumn,
  TableRow,
  TableRowColumn,
  TableHeader,
  TableBody,
} from "@material-ui/core";

export default function FormSubmissions() {
  const [forms, setForms] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/forms/getforms").then((res) => {
      // console.log(res);

      setForms(res.data);
    });
    //console.log(forms);

    //console.log(forms);
  }, []);

  useEffect(() => {
    console.log(forms);

    //console.log(forms);
  }, [forms]);

  return (
    <div>
      <Table>
        <TableHeader>
          <TableRow>
            <TableHeaderColumn>field label</TableHeaderColumn>
            <TableHeaderColumn>input name</TableHeaderColumn>
            <TableHeaderColumn>input type</TableHeaderColumn>
          </TableRow>
        </TableHeader>
        {forms.map((form) => {
          return (
            <TableBody>
              <TableRow>
                <TableRowColumn> {form.fieldLabel}</TableRowColumn>
                <TableRowColumn> {form.inputName}</TableRowColumn>
                <TableRowColumn> {form.inputType}</TableRowColumn>
              </TableRow>
            </TableBody>
          );
        })}
      </Table>
    </div>
  );
}
